#define assume(e) if(!(e)) return 0;
extern int unknown(void);

int main() {

  int c;
  int n;
  int v1;
  int v2;
  int v3;

  (c = 0);
  assume((n > 0));

  while (unknown()) {
    {
      if ( unknown() ) {
        if ( (c > n) )
        {
        (c  = (c + 1));
        }
      } else {
        if ( (c == n) )
        {
        (c  = 1);
        }
      }

    }

  }

if ( (c < 0) )
if ( (c > n) )
{;
//@ assert( (c == n) );
}

}

